import React, { Component } from 'react'

export default class ListTodosComponent extends Component {
    constructor(props) {
        super(props)

        this.state = {
            todos: [
                {id:1, description: "todo_1"},
                {id:2, description: "todo_2"},
                {id:3, description: "todo_3"},
            ]
        }
    }

    render() {
        return (
            <div>
                <h1>List Todos</h1>
                <table>
                    <thead>
                        <tr>
                            <th>id</th>
                            <th>description</th>
                        </tr>
                    </thead>
                </table>
            </div>
        )
    }
}
